import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div>
        Calculadora
      </div>

      <button>+</button>
      <div></div>
      <button>-</button>
      <div></div>
      <button>*</button>
      <button>/</button>
    </div>
  );
}

export default App;
